import React from "react";
function RenderTextInput(props) {
  const { required, passedObj, handler } = props;

  return (
    <div>
      {Object.keys(passedObj).map((category) => {
        return (
          <input
            className={passedObj[category].className}
            key={category}
            type="text"
            id={category}
            onChange={handler}
            value={passedObj[category].value}
            placeholder={passedObj[category].placeholder}
          ></input>
        );
      })}
      {props.required ===true && <div><button> Add </button><button> Remove </button></div>}
    </div>
  );
}

export default RenderTextInput;
